//
//  LoginAPI.swift
//  Created on 23/07/20
//  Created for AnitaB.org Mentorship-iOS 
//

import Foundation
import Combine

class LoginAPI: LoginService {
    struct LoginNetworkModel {
       
        struct LoginResponseData: Decodable {
            let message: String?
            let accessToken: String?

            enum CodingKeys: String, CodingKey {
                case message
                case accessToken = "access_token"
            }

        }
    }
    private var cancellable: AnyCancellable?
    
    func login(
        loginData: LoginModel.LoginUploadData,
        completion: @escaping (LoginModel.LoginResponseData) -> Void
    ) {
        // encode upload data
        guard let uploadData = try? JSONEncoder().encode(loginData) else {
            return
        }
        
        // make network request
        cancellable = NetworkManager.callAPI(urlString: URLStringConstants.Users.login, httpMethod: "POST", uploadData: uploadData)
            .receive(on: RunLoop.main)
            .catch { _ in Just(LoginNetworkModel.LoginResponseData(message: "Login fail", accessToken: "")) }
            .sink {
                let ret = $0
                if let accessToken = ret.accessToken {
                let token = "Bearer " + accessToken
                    do {
                        try KeychainManager.setToken(username: loginData.username, tokenString: token)
                        UserDefaults.standard.set(true, forKey: UserDefaultsConstants.isLoggedIn)
                        completion(LoginModel.LoginResponseData(message: "", sucess: true))
                    } catch {
                    completion(LoginModel.LoginResponseData(message: "Failed to save access token", sucess: false)) }
                } else {
                    completion(LoginModel.LoginResponseData(message: ret.message, sucess: false))
                }
                
        }
    }
}
